import './StyleHeader.css';
import React from 'react';

const iframeStyle = {
    width: '100%',    // Ширина фрейму - 100% ширини контейнера
    height: '100%',   // Висота фрейму - 100% висоти контейнера
    border: 'none',   // Видалити рамку фрейму
  };
const CssText = ()=>{
    return <iframe style={iframeStyle} >
        
    </iframe>
}

export default CssText;
